import React from "react";
import { StyleSheet, css } from "aphrodite/no-important";

const styles = StyleSheet.create({
	h1: {
		fontSize: "7.5em",
		margin: "15px 0px",
		fontWeight: "bold",
	},
	h2: {
		fontWeight: "bold",
	},
});
const Home = () => {
	return (
		<div class="col-md-6 align-self-center">
            <h1> This is the home page</h1> 
		</div>
	);
};

export default Home;
